import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from 'axios';

function First() {
    const [team, setTeam] = useState('');
    const [date, setDate] = useState('');
    const navigate = useNavigate();

    const handleSubmit = () => {
        axios.post('http://localhost:8070/router/fetch', {
            params: { team, date }
           
        })
        .then(response => {
            navigate('/Third',{ state: { data: response.data } });
        })
        .catch(error => {
            console.error('There was an error!', error);
        });
    };

    return (
        <div>
            <label>Team</label>
            <input type="text" name="team" value={team} onChange={(e) => setTeam(e.target.value)} /> <br/>
            
            <label>Date</label>
            <input type="date" name="date" value={date} onChange={(e) => setDate(e.target.value)} /> <br/>

            <button type="button" onClick={() => navigate('/Second')}>Start</button> <br/>

            <button type="button" onClick={handleSubmit}>Search</button>
        </div>
    );
}

export default First;
